INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 7, "2030/12/17 14:59:59", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 7001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 7, "2030/12/17 14:59:59", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 7002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 7, "2030/12/17 14:59:59", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 7003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 10, "2030/12/17 14:59:59", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 10001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 10, "2030/12/17 14:59:59", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 10002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 10, "2030/12/17 14:59:59", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 10003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 10, "2030/12/17 14:59:59", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 10004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -416.5, 0, "ペコリーヌ", 12, "2030/12/17 14:59:59", 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 12001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 13, "2030/12/17 14:59:59", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 13001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 13, "2030/12/17 14:59:59", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 13002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 13, "2030/12/17 14:59:59", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 13003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 13, "2030/12/17 14:59:59", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 13004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 14, "2030/12/17 14:59:59", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 14001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 14, "2030/12/17 14:59:59", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 14002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 14, "2030/12/17 14:59:59", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 14003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 14, "2030/12/17 14:59:59", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 14004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -470.0, 0, "コッコロ", 15, "2030/12/17 14:59:59", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 15001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 16, "2030/12/17 14:59:59", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 16001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 16, "2030/12/17 14:59:59", 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 16002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 16, "2030/12/17 14:59:59", 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 16003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 16, "2030/12/17 14:59:59", 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 16004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 17, "2030/12/17 14:59:59", 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 17002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 25, "2030/12/17 14:59:59", 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 17004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 25, "2030/12/17 14:59:59", 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 17005);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 25, "2030/12/17 14:59:59", 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 17006);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 25, "2030/12/17 14:59:59", 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 17007);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "カリン", 18, "2030/12/17 14:59:59", 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 18001);
