INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 3, 0, -470.0, 0, "カリン", 19, "2030/12/17 14:59:59", 1, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 19001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 4, 0, -470.0, 0, "カリン", 19, "2030/12/17 14:59:59", 1, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 19002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 5, 0, -470.0, 0, "カリン", 20, "2030/12/17 14:59:59", 1, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 20001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 6, 0, -470.0, 0, "カリン", 20, "2030/12/17 14:59:59", 1, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 20002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "キャル", 21, "2030/12/17 14:59:59", 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 21001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "コッコロ", 21, "2030/12/17 14:59:59", 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 21002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 21, "2030/12/17 14:59:59", 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 21003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -363.0, 0, "ペコリーヌ", 21, "2030/12/17 14:59:59", 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 21004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 1, 0, -430.0, 0, "カリン", 22, "2030/12/17 14:59:59", 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 22001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 2, 0, -430.0, 0, "カリン", 22, "2030/12/17 14:59:59", 1, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 22002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 3, 0, -430.0, 0, "カリン", 23, "2030/12/17 14:59:59", 1, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 23001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 1, 4, 0, -430.0, 0, "カリン", 23, "2030/12/17 14:59:59", 1, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 23002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 4.08, "2019/01/31 12:00:00", 1, 1, 0, -385.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 24001);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 5.0, "2019/01/31 12:00:00", 1, 2, 0, -385.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 24002);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 10.11, "2019/01/31 12:00:00", 1, 3, 0, -385.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 24003);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 4.0, "2019/01/31 12:00:00", 1, 4, 0, -385.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 24004);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 6.0, "2019/01/31 12:00:00", 1, 5, 0, -385.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 24005);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 6, 0, 0.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 24006);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 7, 0, 0.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 24007);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 8, 0, 0.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 24008);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 9, 0, 0.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 24009);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 10, 0, 0.0, 10011, "エリコ（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 24010);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 2.12, "2019/01/31 12:00:00", 1, 1, 0, -385.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 24011);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 4.19, "2019/01/31 12:00:00", 5, 2, 0, -385.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 24012);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 2.3, "2019/01/31 12:00:00", 2, 3, 0, -385.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 4, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, 24013);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 4, 0, 0.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 24014);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 5.23, "2019/01/31 12:00:00", 5, 5, 0, -385.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 24015);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 6, 0, 0.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 24016);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (8.0, 5.01, "2019/01/31 12:00:00", 1, 7, 0, -385.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 2, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 24017);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 8, 0, 0.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 24018);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 9, 0, 0.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 24019);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2019/01/31 12:00:00", 1, 10, 0, 0.0, 10011, "シズル（バレンタイン）", 24, "2030/12/17 14:59:59", 1, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 24020);
INSERT INTO `v1_6439a986b45c8ebb08b33ff87cb39ae51374f068d286bee0825146c3105a3402` VALUES (0.0, 0.0, "2015/12/17 15:00:00", 2, 1, 2104010, -363.0, 0, "シェフィ", 26, "2030/12/17 14:59:59", 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 106401, 26001);
